import PEEL_THE_POTATO from "./potatoConstants.js";

export function doSomething(chicken) {
	return {
		type: "DO_SOMETHING",
		payload: { ...chicken },
	}
}

export default function peelThePotato(chicken) {
	console.log('peeling the goddamn potato');
	return {
		type: PEEL_THE_POTATO,
		payload: { ...chicken },
	}
}

export function requestToDatabase(chicken) {
	return {
		type: "REQ_TO_DATABASE",
		payload: { ...chicken },
	}
}
